import React from 'react';
import ListItem from './task-list-item';

const TaskList = ({ data }) => {
    const items = data.map((item) => {
        return (
            <li>
                <ListItem label={items.label} important ={items} />
            </li>
        );
    });



    return (
        <ul>

            <li><ListItem label='Test Task'
                important /></li>
        </ul>
    );
};

export default TaskList;
